class FormValues{get(n){n=n===undefined?"html":`#${n}`;const i=document.querySelectorAll(`${n} [field]`);if(i===undefined||i===null||i.length<=0)return null;let t={};for(const n of i){const i=n.getAttribute("id");if(n.tagName==="SELECT")t[i]=n.value.match(/\d+/g)!==null?parseFloatGr(n.value):n.value,t[`${i}Str`]=n.options[n.selectedIndex].text;else if(n.type=="checkbox")t[i]=n.checked;else switch(n.tagName){case"INPUT":case"TEXTAREA":t[i]=n.classList.contains("money")?parseFloatGr(n.value):n.value;break;default:t[i]=n.classList.contains("money")?parseFloatGr(n.value):n.value}}return t}set(n,t){n=n===undefined?"html":`#${n}`;const i=document.querySelectorAll(`${n} [field]`);if(i===undefined||i===null||i.length<=0)return null;for(const n of i){const i=n.getAttribute("id");if(n.tagName==="SELECT"){const r=Array.from(n.options).find(n=>n.value==t[i]);r&&(r.selected=!0)}else switch(n.tagName){case"INPUT":case"TEXTAREA":n.value=t[i];break;default:n.value=t[i]}}}copyTo(n,t){for(const i in n)n.hasOwnProperty(i)&&t.hasOwnProperty(i)&&(t[i]=n[i])}appPropTo(n,t){for(const i in n)t[i]=n[i]}clear(n){n=n===undefined?"html":`#${n}`;const t=document.querySelectorAll(`${n} [field]`);if(t===undefined||t===null||t.length<=0)return null;for(const n of t)if(n.tagName==="SELECT")n.selectedIndex=0;else switch(n.tagName){case"INPUT":case"TEXTAREA":n.value="";break;default:n.value=""}}}